import { MEMBER_CARD, MEMBER_CARD_SPECIAL_NOTE } from "./member-card.config";
export default {
  bem: {
    h5: 'brand-card-h5',
    card: 'brand-card-h5__card',
    select: 'brand-card-h5__select',
    other: 'brand-card-h5__other'
  },
  props: {
    data: Object,
    cardType: Number,
    isAdd: {
      type: Boolean,
      default: false
    }
  },
  data: function data() {
    return {
      selectCard0: [],
      selectCard1: [],
      selectCard2: [],
      MEMBER_CARD: MEMBER_CARD
    };
  },
  filters: {
    typeFilter: function typeFilter(val) {
      var types = {
        1: '天',
        2: '月',
        3: '年'
      };
      return types[val];
    }
  },
  created: function created() {
    this.selectCard0 = [{
      price: '300',
      month: '1个月'
    }, {
      price: '600',
      month: '3个月'
    }, {
      price: '1000',
      month: '6个月'
    }, {
      price: '1300',
      month: '12个月'
    }];
    this.selectCard1 = [{
      price: '300',
      frequency: '10次'
    }, {
      price: '600',
      frequency: '30次'
    }, {
      price: '1000',
      frequency: '60次'
    }, {
      price: '1300',
      frequency: '120次'
    }];
    this.selectCard2 = [{
      price: '300'
    }]; // 卡项特殊说明初始值

    if (this.isAdd) {
      switch (this.cardType) {
        case this.MEMBER_CARD.PERIOD_CARD:
          return this.data.special_note = MEMBER_CARD_SPECIAL_NOTE.PERIOD_CARD;

        case this.MEMBER_CARD.NUMBER_CARD:
          return this.data.special_note = MEMBER_CARD_SPECIAL_NOTE.NUMBER_CARD;

        case this.MEMBER_CARD.DEPOSIT_CARD:
          return this.data.special_note = MEMBER_CARD_SPECIAL_NOTE.DEPOSIT_CARD;
      }
    }
  }
};
